def knight_min_health(dungeon):
    dp = [[0 for i in range(len(dungeon[0])+1)] for j in range(len(dungeon)+1)]
    for i in range(len(dungeon)+1):
        dp[i][0] = -dungeon[i-1][0] if i > 0 else float('-inf')
    for j in range(len(dungeon[0])+1):
        dp[0][j] = -dungeon[0][j-1] if 0 < j < len(dungeon[0]) else float('-inf')
    for i in range(1, len(dungeon)+1):
        for j in range(1, len(dungeon[0])+1):
            if dungeon[i-1][j-1] > 0:
                dp[i][j] = max(dp[i][j-1], dp[i-1][j-1] - dungeon[i-1][j-1])
            if dungeon[i-1][j-1] < 0:
                dp[i][j] = max(dp[i][j-1], dp[i-1][j-1] + dungeon[i-1][j-1])
            if dungeon[i-1][j-1] == 0:
                dp[i][j] = max(dp[i][j-1], dp[i-1][j-1])
    return dp[-1][-1]

