import sys
from collections import deque

def main():
    n, m, d = list(map(int, sys.stdin.readline().split()))
    p = list(map(int, sys.stdin.readline().split()))
    graph = [[] for i in range(n)]
    for i in range(n-1):
        a, b = list(map(int, sys.stdin.readline().split()))
        a -= 1
        b -= 1
        graph[a].append(b)
        graph[b].append(a)
    q = deque()
    for i in range(n):
        if p[i] == 0:
            q.append(i)
            graph[i].append(n-1)
            graph[n-1].append(i)
            p[i] = 1
    while q:
        i = q.popleft()
        for j in graph[i]:
            if graph[j][0] == -1:
                graph[j].append(0)
                p[j] = max(p[i] - 1, 0)
            else:
                graph[j][0] = p[i] - 1
                q.append(j)
    ans = 0
    for i in range(n):
        if p[i] == 0:
            if d <= p[i] or p[i] <= d:
                ans += 1
    print(ans)

