def dfs(node, par, depth):
    stack = deque([(node, 0)])
    while stack:
        n, d = stack.pop()
        if d > depth:
            depth = d
            prev = n
            n = graph[n][0]
        for i in graph[n]:
            if i != par:
                stack.append((i, d + 1))
                graph[n].append(i)
                graph[i].append(n)
    return n, prev

def solve(node, par, depth):
    stack = deque([(node, 0)])
    while stack:
        n, d = stack.pop()
        if d > depth:
            depth = d
            prev = n
            n = graph[n][0]
        for i in reversed(graph[n]):
            if i != par:
                stack.append((i, d + 1))
                graph[n].append(i)
                graph[i].append(n)
        if n == 1:
            return par, depth
        for i in reversed(graph[n]):
            if i != par:
                a, b = solve(i, n, depth + 1)
                if a:
                    graph[n].append(a)
                    graph[a].append(n)
                    return a, depth + 1
                graph[i].append(b)
                graph[b].append(i)
    return None, depth

