    if x == 2: 
        return True 
    if x <= 1 or not notmultiple(x, 2): 
        return False 
    for i in range(2,int(math.sqrt(x)+1)): 
        if x%i == 0: 
            return False 
    return True 

def factors(x): 
    f = [] 
    i = 1 
    while i*i <= x: 
        if x % i == 0: 
            f.append(i) 
            if x//i != i: 
                f.append(x//i) 
        i += 1 
    return f 

